    constructor(props) {
        super(props);
        alert(this.props.json);
    }

    render() {
        alert(this.props.json);
        return (
            <div className="grid">
                <NumberRow />
                <NumberColumn />
                <PeriodicTable json={this.props.json} />
            </div>
        );
    }
}


export default Page
